import React from "react";
import "./allLogin.css";
import Header from "./ProductsPage/Header";
function Error() {
  return (
    <>
      <Header name="user" />
      <div className="err">ERROR! PAGE NOT FOUND</div>
    </>
  );
}

export default Error;
